    <h1>User index</h1>
 <a href=\"{{ path('app_user_new') }}\">Create new</a>
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id_user</th>
                <th>Nom</th>
                <th>Prenom</th>
                <th>Email</th>
                <th>Password</th>
                <th>Num_telephone</th>
                <th>Date_de_naissance</th>
                <th>Genre</th>
                <th>Role</th>
                <th>Image</th>
                <th>Reset_code</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.idUser }}</td>
                <td>{{ user.nom }}</td>
                <td>{{ user.prenom }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.password }}</td>
                <td>{{ user.numTelephone }}</td>
                <td>{{ user.dateDeNaissance ? user.dateDeNaissance|date('Y-m-d') : '' }}</td>
                <td>{{ user.genre }}</td>
                <td>{{ user.role }}</td>
                <td>{{ user.image }}</td>
                <td>{{ user.resetCode }}</td>
                <td>
                    <a href=\"{{ path('app_user_show', {'id_user': user.id_user}) }}\">show</a>
                    <a href=\"{{ path('app_user_edit', {'id_user': user.id_user}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"12\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

  
{% endblock %}
